function labelCodeSamples(){$(".highlight").filter(':contains("GOOD PRACTICE")').addClass("good").end().filter(':contains("BAD PRACTICE")').addClass("bad")}function addTableOfContents(){var e=$("h3");if(0!==e.length){var t=e.map(function(){var e=$(this);return'\n<li><a href="#'+e.attr("id")+'">'+e.text()+"</a></li>"}).get().join("");$("h2").before('<div id="toc"><span>On this Page:</span><ul>'+t+"</ul></div>")}}function initSearch(){var e=$("#search-wrapper");if(0!==e.length){var t=getQueryVariable("query");return null===t||""===t?void e.html("<p>No search term was provided</p>"):void e.html('<iframe src="http://www.google.com/cse?q='+encodeURIComponent(t)+'&amp;cx=006455971487473204572%3A398_hnsuc6g&cof=FORID%3A11" class="search-results"></iframe>')}}function getQueryVariable(e){for(var t=window.location.search.substring(1),i=t.split("&"),a=0;a<i.length;a++){var r=i[a].split("=");if(r[0]==e)return r[1]}return null}this.imagePreview=function(){xOffset=160,yOffset=50,$("a.preview").hover(function(e){this.t=this.title,this.title="";var t=""!=this.t?"<br/>"+this.t:"";$("body").append("<p id='preview'><img src='"+this.href+"' alt='Image preview' />"+t+"</p>"),$("#preview").css("top",e.pageY-yOffset+"px").css("left",e.pageX+xOffset+"px").fadeIn("fast")},function(){this.title=this.t,$("#preview").remove()}),$("a.preview").mousemove(function(e){$("#preview").css("top",e.pageY-yOffset+"px").css("left",e.pageX+xOffset+"px")})},$(function(){imagePreview(),labelCodeSamples(),addTableOfContents(),initSearch()});